import React from 'react';

const ProductDetail = ({ product }) => {
  return (
    <div>
        <h3>{product.name}</h3>
      <p>{product.description}</p>
      <p>Giá: {product.price}</p>
      {/* Các thông tin khác về sản phẩm */}
    </div>
  );
};

export default ProductDetail;
